import React, { useState } from 'react'
import axios from 'axios'

function Side_work() {
  const [userdata, setuserdata] = useState([])

  const fetchdata = async () => {
    const res = await axios.get("https://picsum.photos/v2/list?page=2&limit=100")
    setuserdata(res.data)
  }

  let printdata = "user not found"

  if (userdata.length > 0) {
      printdata = userdata.map((elem, index) => {
      return (
        <div  >
          <img 
            src={elem.download_url} 
            alt="img" 
            style={{ width: "250px", height: "250px", objectFit: "cover" , borderRadius: "10px" }}
        
          />
           <h3 className=' position-absolute top-0 start-1 m-5'>{index+1}</h3>   {/* ‚Üê Shows the ID easily */}
              <h4>{elem.author}</h4>
        </div>
      )
    })
  }

  return (
<div className='bg-dark text-white text-center w-100' style={{ minHeight: "100vh" }}>

      <button className='btn btn-danger m-5' onClick={fetchdata}>
        GetData
      </button>

      <div className='d-flex flex-wrap justify-content-center'>
        {printdata}
      </div>
    </div>
  )
}

export default Side_work
